description:
Nar den konststuderande Ben Willis blir dumpad av sin flickvan
Suzy, drabbas han av somnloshet. Och for att klara av de langa
natterna, borjar han jobba det sena nattskiftet pa det lokala
supermarket, dar han traffar en rad fargstarka karaktarer....
